import { TableRow } from "./TableRow"

export const ListOfEntries = ({ tableTitles, advisorsArray }) => {


    return (
        <section id="list-of-entries">
            <table>
                <thead>
                    <tr>
                        {tableTitles.map(function (title) {
                            return (
                                <>
                                    <th key={title.id}>{title.id}</th>
                                </>
                            )
                        })}
                    </tr>
                </thead>
                <tbody>
                    {advisorsArray.map(function (advisor) {
                        return (
                            <TableRow key={advisor.id} entry={advisor} />
                        )
                    })}
                </tbody>
            </table >

        </section>
    )
}
